using VictoryCenter.BLL.Interfaces.BlobStorage;
using VictoryCenter.DAL.Data;
using VictoryCenter.DAL.Entities;

namespace VictoryCenter.IntegrationTests.Utils.Seeder.ImageSeeder;

public class ImagesDataSeeder
{
    private static readonly List<Image> _images =
    [
        new Image
        {
            BlobName = "testname1",
            Base64 =
                "data:image/jpeg;base64,",
            MimeType = "image/jpg"
        },
        new Image
        {
            BlobName = "testname2",
            Base64 =
                "data:image/jpeg;base64,",
            MimeType = "image/jpg"
        }

    ];

    public static async Task SeedData(VictoryCenterDbContext dbContext, IBlobService service)
    {
        dbContext.Images.AddRange(_images);
        dbContext.SaveChanges();
        foreach (Image image in _images)
        {
            await service.SaveFileInStorageAsync(image.Base64, image.BlobName, image.MimeType);
        }
    }
}
